package Day5;

import javax.swing.text.html.Option;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.LinkedList;
import java.util.Optional;
import java.util.stream.Collectors;

public class Day5 {

    public static final String POLYMER = "";
    public static final String AlPHABETH = "Aa,Bb,Cc,Dd,Ee,Ff,Gg,Hh,Ii,Jj,Kk,Ll,Mm,Nn,Oo,Pp,Qq,Rr,Ss,Tt,Uu,Vv,Ww,Xx,Yy,Zz";

    public static void main(String[] args) {
        String[] polymerCharacterString = POLYMER.split("");
        String[] alphabethCharacterString = AlPHABETH.split(",");
        String initialPolymer = getPolymer(polymerCharacterString);
        System.out.println(initialPolymer.length());
        System.out.println(Arrays.stream(alphabethCharacterString)
                .map(letterToRemove -> POLYMER
                        .replace(letterToRemove.charAt(0) + "", "")
                        .replace(letterToRemove.charAt(1) + "", "").split(""))
//                .peek(s -> {
//                    for (int i = 0; i< s.length; i++) {
//                        System.out.print(s[i]);
//                    }
//                    System.out.println();
//                })
                .mapToInt(reducedPOLYMER -> getPolymer(reducedPOLYMER).length())
                .min().orElse(-1));
    }

    private static String getPolymer(String[] characterString) {
        return Arrays.stream(characterString).
                    reduce((a, b) -> (a.equals("") || Math.abs(a.charAt(a.length() - 1) - b.charAt(0)) != 32) ? a+b : a.substring(0, a.length() - 1)).orElse("");
    }
}
